import React, { Component } from "react";
import Grid from "@material-ui/core/Grid";
import ReactPlayer from "react-player";
import Card from "@material-ui/core/Card";
import CardMedia from "@material-ui/core/CardMedia";
import CardActionArea from "@material-ui/core/CardActionArea";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";
import { withRouter } from "react-router-dom";
import CardA from "./CardA";
import CardB from "./CardB";

class LandingPage extends Component {
  GoToCardA() {
    this.props.history.push("/About");
  }

  handleClick(e) {
    this.GoToCardA("element clicked");
  }

  render() {
    return (
      <div>
        <div className="grid_root">
          <Grid container justify="center">
            {/* First Item */}

            <Grid item xs={12} sm={6} md={6} className="overlay2">
              <white1> Howe Yang </white1>
              <black1> Developer & Designer</black1>
              <h2>https://material-ui.com/components/grid/</h2>
            </Grid>

            {/* Second Item */}

            <Grid
              item
              xs={12}
              sm={6}
              md={6}
              className="section container-overlay"
            >
              <h2 className="overlay">Most Recent Project</h2>
              <ReactPlayer
                url="test.mp4"
                width="100%"
                height="100%"
                controls="true"
                playing
              />
            </Grid>

            <Grid item xs={12} sm={3} md={3}>
              <div className="section">
                <Card>
                  <CardActionArea onClick={this.handleClick.bind(this)}>
                    <CardMedia
                      className="card"
                      image={require("./color4.png")}
                      title="Shibaaaaaa"
                    />
                    <CardContent>
                      <Typography gutterBottom variant="h5" component="h2">
                        Project 1
                      </Typography>
                      <Typography
                        variant="body2"
                        color="textSecondary"
                        component="p"
                      >
                        The Shiba Inu is a Japanese breed of hunting dog. A
                        small, agile dog that copes very well with mountainous
                        terrain, the Shiba Inu was originally bred for hunting.
                      </Typography>
                    </CardContent>
                  </CardActionArea>
                </Card>
              </div>
            </Grid>

            <CardB />
            <Grid item xs={6} sm={3} md={3}>
              <div className="section"> wee </div>
            </Grid>
            <Grid item xs={6} sm={3} md={3}>
              <div className="section"> wee </div>
            </Grid>
          </Grid>
        </div>
      </div>
    );
  }
}

export default LandingPage;
